'''Captain Khaled''' is a thug who is found in the foodhall, the large eastern building in [[Port Piscarilius]]. He is a former pirate who got tired of sea piracy, so he and his crewmembers decided to steal artefacts from houses in the residential district and ship the stolen goods overseas. The authorities of Port Piscarilius allows them to do so through political corruption and bribery.

==Stealing Artefacts==
Captain Khaled can assign players to [[Stealing artefacts|steal artefacts]] from houses within the Piscarilius area with level 49 [[Thieving]] and 75% Piscarilius favour in exchange for coins, Piscarilius favour and some thieving experience. When an artefact is acquired, do not teleport or it will disappear and another assignment will have to be given.

==Treasure Trails==
{{Cipher|Captain Khaled|medium|ECRVCKP MJCNGF}}. The answer to his challenge: ''How many fishing cranes can you find around here?'' is: ''5''.

